	void doATest(IAlgoCompress algo, List<ISymbol> ls,double symbolratio,double coderatio)
	{
		print(algo.getName());
		print(ls.size()+" : e="+ISymbol.getEntropie(ls)+" : "+ls );
		algo.reset();
		algo.init(ls);
		List<ISymbol>  lse=algo.encodeSymbol(ls);
		print(lse.size()+" : e="+ISymbol.getEntropie(lse)+" : "+lse );
		algo.reset();
		List<ISymbol>  lsdec=algo.decodeSymbol(lse);
		print(lsdec.size()+" : "+lsdec );
		
	    print("symbol ratio:"+lse.size()+"/"+ls.size()+":"+String.format("%2.2f", ((lse.size()*100.0)/ls.size()))+"%");
	    assertTrue(ls.size()*symbolratio>= lse.size());
		
		assertEquals(ls, lsdec);
		
		
	//	assertTrue(ISymbol.getEntropie(ls)+0.1>= ISymbol.getEntropie(lse));
	
		ICodingRule crls=HuffmanCode.Factory(ls);
		ICodingRule crlse=HuffmanCode.Factory(lse);
		long lene=ISymbol.length(lse, crlse);
		long len=ISymbol.length(ls, crls);
		print("code ratio:"+lene+"/"+len+":"+String.format("%2.2f", ((lene*100.0)/len))+"%");
		assertTrue((len*coderatio)>=lene);
	//	assertNotEquals(ls, lse);
	}

